import Returns from './pages/returns';
import LabelPrint from './pages/LabelPrint';
import ItemSelect from './pages/ItemSelect';
import { Switch, BrowserRouter, Router, Route } from 'react-router-dom';

import React, { Component } from 'react';
import './App.css';
import NavBar from './components/NavBar';

export class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <NavBar />
          <Switch>
            <Route path='/' exact component={Returns} />
            <Route path='/myreturns' component={ItemSelect} />
            <Route path='/printlabel' exact component={LabelPrint} />
          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
